import { Component } from 'react';
import Button from '@mui/material/Button';
import Dialog from '@mui/material/Dialog';
import DialogActions from '@mui/material/DialogActions';
import DialogContent from '@mui/material/DialogContent';
import DialogContentText from '@mui/material/DialogContentText';
import DialogTitle from '@mui/material/DialogTitle';

class DeleteDataset extends Component {
    constructor(props) {
        super(props)
        this.state = {
            httpMethod: 'DELETE',
            open: false
        };

        this.handleSubmit = this.handleSubmit.bind(this)
    }

    handleSubmit(e) {
        e.preventDefault();
        this.setState({ open: false });
        this.props.handleSendRequest(JSON.stringify(this.props.datasetConfigJSON), this.state.httpMethod)
    }

    handleClickOpen = () => {
        this.setState({ open: true });
    };

    handleClose = () => {
        this.setState({ open: false });
    };

    render() {
        return (

            <div>
                {/*<form>*/}
                {/*    <h2>Do you want to Delete {this.props.datasetConfigJSON.name}?</h2>*/}
                {/*    <button onClick={this.handleSubmit}>Yes</button>*/}

                {/*</form>*/}


                <Button variant="outlined" onClick={this.handleClickOpen}>
                    Open Delete dialog
                </Button>

                <Dialog
                    open={this.state.open}
                    onClose={this.handleClose}
                    aria-labelledby="alert-dialog-title"
                    aria-describedby="alert-dialog-description"
                >
                    <DialogTitle id="alert-dialog-title">
                        Do you want to Delete {this.props.datasetConfigJSON.name}?
                    </DialogTitle>
                    <DialogContent>
                        <DialogContentText id="alert-dialog-description">
                            This will Delete {this.props.datasetConfigJSON.name} from Alluxio Cluster.
                        </DialogContentText>
                    </DialogContent>
                    <DialogActions>
                        <Button onClick={this.handleClose}>No</Button>
                        <Button onClick={this.handleSubmit} autoFocus>Yes</Button>
                    </DialogActions>
                </Dialog>



            </div>



        )
    }
}


export default DeleteDataset
